import React from 'react';
import Tags from './Tags/Tags'
import ikeaImage from '../images/ikeaImage.jpg'

import useStyles from './styles'


function IkeaImage() {
  return (
      <div >
        <img src={ikeaImage}/>
        <Tags />
      </div>
  );
}

export default IkeaImage;
